/**
 * Extraire les num√©ros d'un fichier Excel
 */
async function extractFromExcel(buffer) {
    const tempFile = path.join(__dirname, "..", "assets", `temp_${Date.now()}.xlsx`);
    fs.writeFileSync(tempFile, buffer);

    const workbook = new ExcelJS.Workbook();
    await workbook.xlsx.readFile(tempFile);

    const phoneNumbers = [];
    const worksheet = workbook.worksheets[0];

    worksheet.eachRow((row, rowNumber) => {
        if (rowNumber === 1) return; // Skip header

        row.eachCell((cell) => {
            const value = cell.value?.toString().trim();
            if (value && /^\d+$/.test(value)) {
                // Nettoyer le num√©ro
                const cleanNumber = value.replace(/\D/g, "");
                if (cleanNumber.length >= 9) {
                    phoneNumbers.push(cleanNumber);
                }
            }
        });
    });

    fs.unlinkSync(tempFile);
    return [...new Set(phoneNumbers)]; // Supprimer les doublons
}

/**
 * Extraire les num√©ros d'un fichier VCF
 */
async function extractFromVCF(buffer) {
    const vcfContent = buffer.toString("utf8");
    const phoneNumbers = [];

    // Parser simple pour VCF
    const lines = vcfContent.split("\n");
    for (const line of lines) {
        if (line.startsWith("TEL")) {
            const match = line.match(/:([\d\s\+\-\(\)]+)/);
            if (match) {
                const cleanNumber = match[1].replace(/\D/g, "");
                if (cleanNumber.length >= 9) {
                    phoneNumbers.push(cleanNumber);
                }
            }
        }
    }

    return [...new Set(phoneNumbers)]; // Supprimer les doublons
}

/**
 * Envoyer les messages de prospection avec anti-ban
 */
async function sendProspectMessages(message, phoneNumbers, config) {
    const sock = message.client.getSocket();
    const startTime = Date.now();

    const minDelay = config.AUTO_RESPONDER_MIN_DELAY || 1000;
    const maxDelay = config.AUTO_RESPONDER_MAX_DELAY || 3000;
    const typingSpeed = config.AUTO_RESPONDER_TYPING_SPEED || 50;
    const maxTypingTime = config.AUTO_RESPONDER_MAX_TYPING_TIME || 10000;
    const rateLimit = config.AUTO_RESPONDER_RATE_LIMIT || 5;
    const rateWindow = config.AUTO_RESPONDER_RATE_WINDOW || 60000;

    let sent = 0;
    let failed = 0;
    let skipped = 0;
    const failedNumbers = [];

    let messagesSentInWindow = 0;
    let windowStartTime = Date.now();

    for (let i = 0; i < phoneNumbers.length; i++) {
        const phoneNumber = phoneNumbers[i];
        const jid = `${phoneNumber}@s.whatsapp.net`;

        try {
            // V√©rifier le rate limit
            const now = Date.now();
            if (now - windowStartTime >= rateWindow) {
                // Nouvelle fen√™tre
                messagesSentInWindow = 0;
                windowStartTime = now;
            }

            if (messagesSentInWindow >= rateLimit) {
                // Attendre la fin de la fen√™tre
                const waitTime = rateWindow - (now - windowStartTime);
                console.log(
                    `‚è≥ Rate limit atteint. Pause de ${Math.ceil(waitTime / 1000)}s...`
                );
                await sleep(waitTime);
                messagesSentInWindow = 0;
                windowStartTime = Date.now();
            }

            // V√©rifier si le num√©ro existe sur WhatsApp
            const [exists] = await sock.onWhatsApp(jid);
            if (!exists || !exists.exists) {
                console.log(`‚è≠Ô∏è Num√©ro non enregistr√©: ${phoneNumber}`);
                skipped++;
                continue;
            }

            // Simuler la frappe
            const typingTime = Math.min(
                PROSPECT_MESSAGE.length * typingSpeed,
                maxTypingTime
            );
            await sock.sendPresenceUpdate("composing", jid);
            await sleep(typingTime);
            await sock.sendPresenceUpdate("paused", jid);
            const buffer = Buffer.from(imageBase64, 'base64');
            // Envoyer le message
            await sock.sendMessage(jid, { image: {url:'./assets/image.jpg'}, caption: PROSPECT_MESSAGE });

            sent++;
            messagesSentInWindow++;

            console.log(
                `‚úÖ Message envoy√© [${sent}/${phoneNumbers.length}]: ${phoneNumber}`
            );

            // Notification de progression tous les 10 messages
            if (sent % 10 === 0) {
                await message.reply(
                    `üìä *Progression:* ${sent}/${phoneNumbers.length} (${Math.round(
                        (sent / phoneNumbers.length) * 100
                    )}%)`
                );
            }

            // D√©lai al√©atoire entre les messages
            const delay = Math.floor(Math.random() * (maxDelay - minDelay)) + minDelay;
            await sleep(delay);
        } catch (error) {
            console.error(`‚ùå Erreur pour ${phoneNumber}:`, error.message);
            failed++;
            failedNumbers.push(phoneNumber);

            // En cas d'erreur de ban potentiel, pause plus longue
            if (
                error.message.includes("rate") ||
                error.message.includes("spam") ||
                error.message.includes("429")
            ) {
                console.log("‚ö†Ô∏è Erreur de rate limit d√©tect√©e. Pause de 2 minutes...");
                await message.reply(
                    "‚ö†Ô∏è *Rate limit d√©tect√©!* Pause de 2 minutes pour s√©curit√©..."
                );
                await sleep(120000); // 2 minutes
                messagesSentInWindow = 0;
                windowStartTime = Date.now();
            }
        }
    }

    const duration = Date.now() - startTime;

    return {
        sent,
        failed,
        skipped,
        failedNumbers,
        duration,
    };
}

/**
 * Fonction sleep
 */
function sleep(ms) {
    return new Promise((resolve) => setTimeout(resolve, ms));
}

/**
 * Estimer le temps total
 */
function estimateTime(count, minDelay, maxDelay) {
    const avgDelay = (minDelay + maxDelay) / 2;
    const totalMs = count * (avgDelay + 2000); // +2s pour typing
    const minutes = Math.ceil(totalMs / 60000);

    if (minutes < 60) {
        return `${minutes} minutes`;
    } else {
        const hours = Math.floor(minutes / 60);
        const mins = minutes % 60;
        return `${hours}h ${mins}min`;
    }
}

/**
 * Formater la dur√©e
 */
function formatDuration(ms) {
    const seconds = Math.floor(ms / 1000);
    const minutes = Math.floor(seconds / 60);
    const hours = Math.floor(minutes / 60);

    if (hours > 0) {
        return `${hours}h ${minutes % 60}min`;
    } else if (minutes > 0) {
        return `${minutes}min ${seconds % 60}s`;
    } else {
        return `${seconds}s`;
    }
}